(350, 'Granville Espadrille', 'granville-espadrille', NULL, 25, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Signature &#39;Christian Dior&#39; embroidered on the upper</li>\r\n	<li>Brown leather inner sole</li>\r\n	<li>Rope wedge and thin rubber sole with a star emblem</li>\r\n	<li>Made in Italy<br />\r\n	&nbsp;</li>\r\n</ul>', 2, NULL, 'tHkikl', NULL, NULL, 1, 0, 1, '2020-11-19 11:52:16', '2021-01-19 17:12:07', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '43'),
