(405, 'Pink Pineapple Sling-back Sandals', 'pink-pineapple-sling-back-sandals', NULL, 22, NULL, NULL, NULL, NULL, '<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Condition</td>\r\n			<td>Never Worn Still With Tags</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Item Category</td>\r\n			<td><a href=\"https://www.hardlyeverwornit.com/search_results.php?filters[department][]=1&amp;filters[item_type][]=89\" title=\"Heeled Shoes\">Ladies Heeled Shoes</a><br />\r\n			<a href=\"https://www.hardlyeverwornit.com/search_results.php?filters[department][]=1&amp;filters[item_type][]=87\" title=\"Sandals\">Ladies Sandals</a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Fabric</td>\r\n			<td>Cloth / Leather</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Colour</td>\r\n			<td>Pink</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 2, NULL, 'dtYUYX', NULL, NULL, 1, 0, 1, '2020-12-01 17:54:57', '2020-12-28 00:50:37', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '39'),
(406, 'Gold Pointed Toe Pumps', 'gold-pointed-toe-pumps', NULL, 40, NULL, NULL, NULL, NULL, '<p>Gold pumps from Fausto Puglisi featuring a pointed toe, gold-tone hardware, a slip-on style, a branded insole, a high stiletto heel, and a bow embellishment to the front.</p>\r\n\r\n<p>Made in Italy</p>\r\n\r\n<h4>Composition</h4>\r\n\r\n<p>Sole: Leather 100%</p>\r\n\r\n<p>Lining: Leather 100%</p>\r\n\r\n<p>Outer: Polyamide 100%</p>', 2, NULL, 'BzG3o0', NULL, NULL, 1, 0, 1, '2020-12-01 18:09:58', '2020-12-28 00:52:15', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '37'),
(407, 'Jeweled Floral-Print Patent Leather Slingback Pumps', 'jeweled-floral-print-patent-leather-slingback-pumps', NULL, 22, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Dolce &amp; Gabbana floral-print patent leather pump.</li>\r\n	<li>2.4&quot; covered heel.</li>\r\n	<li>Pointed toe.</li>\r\n	<li>Crystal flower embellishment.</li>\r\n	<li>Adjustable slingback strap.</li>\r\n	<li>Smooth outsole.</li>\r\n	<li>Made in Italy.</li>\r\n</ul>', 2, NULL, 'meNYe3', NULL, NULL, 1, 1, 1, '2020-12-01 18:15:58', '2020-12-28 00:52:26', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '38.5'),
(408, 'Floral Brocade Fabric Logo Slide Mules', 'floral-brocade-fabric-logo-slide-mules', NULL, 22, NULL, NULL, NULL, NULL, '<p>&nbsp;</p>\r\n\r\n<p>These trendy slides from Dolce &amp; Gabbana are simple yet fashionable. They are crafted from gold brocade fabric and designed with covered toes and DG detailing on the uppers. You will truly love to own these beauties.</p>\r\n\r\n<p>Gender - Women</p>\r\n\r\n<p>Includes - Original Box, Receipts</p>\r\n\r\n<p>Hardware - Gold-tone</p>\r\n\r\n<p>Lining Material - Leather</p>\r\n\r\n<p>Exterior Material - Fabric</p>\r\n\r\n<p>Insole Material - Leather</p>\r\n\r\n<p>Sole Material - Leather</p>\r\n\r\n<p>Origin - Italy</p>\r\n\r\n<p>Closure Type - Slip-On</p>', 2, NULL, 'ByVufH', NULL, NULL, 1, 0, 1, '2020-12-01 18:34:14', '2020-12-08 22:11:29', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '39'),
(409, 'Red Brocade Fabric Logo Slide Mules', 'red-brocade-fabric-logo-slide-mules', NULL, 22, NULL, NULL, NULL, NULL, '<p>These trendy slides from Dolce &amp; Gabbana are simple yet fashionable. They are crafted from gold brocade fabric and designed with covered toes and DG detailing on the uppers. You will truly love to own these beauties.</p>\r\n\r\n<p>Gender - Women</p>\r\n\r\n<p>Includes - Original Box, Receipts</p>\r\n\r\n<p>Hardware - Red</p>\r\n\r\n<p>Lining Material - Leather</p>\r\n\r\n<p>Exterior Material - Fabric</p>\r\n\r\n<p>Insole Material - Leather</p>\r\n\r\n<p>Sole Material - Leather</p>\r\n\r\n<p>Origin - Italy</p>\r\n\r\n<p>Closure Type - Slip-On</p>', 2, NULL, 'OyDBQ6', NULL, NULL, 1, 0, 1, '2020-12-01 18:43:17', '2020-12-08 22:13:00', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '40.5'),
(410, 'Lucrezia Bow-Embellished Black Point-Toe Flats', 'lucrezia-bow-embellished-black-point-toe-flats', NULL, 35, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Flats</li>\r\n	<li>Black</li>\r\n	<li>Crystals</li>\r\n	<li>Bow-embellished</li>\r\n	<li>Pointed toe</li>\r\n	<li>Slight heel</li>\r\n	<li>Slip-on</li>\r\n	<li>Leather sole</li>\r\n	<li>Made in Italy</li>\r\n	<li>Textile fibers 100%</li>\r\n</ul>', 2, NULL, 'ZTf1d2', NULL, NULL, 1, 0, 1, '2020-12-01 18:56:19', '2021-03-14 23:22:19', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '39'),
(411, 'Bead-Embellished Suede Espadrille Flat', 'bead-embellished-suede-espadrille-flat', NULL, 35, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Giuseppe Zanotti bead-embellished calf suede espadrille.</li>\r\n	<li>0.3&quot; flat heel.</li>\r\n	<li>Jute-capped round toe.</li>\r\n	<li>Metallic logo bar detail.</li>\r\n	<li>Braided jute midsole.</li>\r\n	<li>Slip-on style.</li>\r\n	<li>Made in Spain.</li>\r\n</ul>', 2, NULL, 'Y37lLr', NULL, NULL, 1, 0, 1, '2020-12-01 19:22:26', '2021-03-14 23:22:26', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '40'),
(412, 'Taupe Bead-Embellished Suede Espadrille Flat', 'taupe-bead-embellished-suede-espadrille-flat', NULL, 35, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Giuseppe Zanotti bead-embellished calf suede espadrille.</li>\r\n	<li>0.3&quot; flat heel.</li>\r\n	<li>Jute-capped round toe.</li>\r\n	<li>Metallic logo bar detail.</li>\r\n	<li>Braided jute midsole.</li>\r\n	<li>Slip-on style.</li>\r\n	<li>Made in Spain.</li>\r\n</ul>', 2, NULL, '1bPPpc', NULL, NULL, 1, 0, 1, '2020-12-01 19:27:51', '2021-03-14 23:22:33', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '43'),
(413, 'Embellished Floral Print Patent Leather Point Toe Flats', 'embellished-floral-print-patent-leather-point-toe-flats', NULL, 22, NULL, NULL, NULL, NULL, '<p>Dolce &amp; Gabbana&rsquo;s flats have been crafted in Italy from glossy black patent-leather in a flattering point-toe silhouette. Trimmed with pastel-gold piping, this pair is decorated with a crystal-encrusted flower pendant that matches the label&rsquo;s signature rose and peony print. Wear yours with everything from sleek tailoring to jeans or dresses.</p>\r\n\r\n<p>&ndash; Slight heel<br />\r\n&ndash; Multicolored patent-leather<br />\r\n&ndash; Slip-on<br />\r\n&ndash; Made in Italy<br />\r\n&ndash; Fits true to size, take your normal size<br />\r\n&ndash; Italian sizing<br />\r\n&ndash; Narrow at the toe</p>', 2, NULL, 'RLrFKM', NULL, NULL, 1, 1, 1, '2020-12-01 19:35:42', '2020-12-08 22:14:26', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '41'),
(414, 'Leather Flats with Wings Patch', 'leather-flats-with-wings-patch', NULL, 35, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>Made in Italy</li>\r\n	<li>Ballet flats</li>\r\n	<li>Crystals</li>\r\n	<li>Bow detail</li>\r\n	<li>Round toe</li>\r\n	<li>Slip-on</li>\r\n	<li>Textured-leather</li>\r\n	<li>Gold-tone</li>\r\n	<li>100% Leather</li>\r\n</ul>', 2, NULL, 'M7udVk', NULL, NULL, 1, 0, 1, '2020-12-01 19:54:17', '2021-03-14 23:26:21', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '40'),
