(423, 'Ellison Logo-Print Cotton T-shirt', 'ellison-logo-print-cotton-t-shirt', NULL, 6, NULL, NULL, NULL, NULL, '<ul style=\"margin-left:0px; margin-right:0px\">\r\n	<li style=\"list-style-type:disc\">COLOUR: White</li>\r\n	<li style=\"list-style-type:disc\">COMPOSITION: 100% cotton.</li>\r\n	<li style=\"list-style-type:disc\">CARE: Machine wash</li>\r\n	<li style=\"list-style-type:disc\">Lightweight cotton jersey</li>\r\n	<li style=\"list-style-type:disc\">Logo print</li>\r\n</ul>', 2, NULL, 'pOpINV', NULL, NULL, 1, 0, 1, '2020-12-09 13:37:39', '2020-12-28 00:47:58', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'M'),
(424, 'Polished Leather Penny Loafer', 'polished-leather-penny-loafer', NULL, 16, NULL, NULL, NULL, NULL, '<div class=\"product-detail\">\r\n<p>An essential style suitable for many occasions, the classic penny loafer is offered in smooth, polished leather for a refined look.</p>\r\n\r\n<ul>\r\n	<li>Black polished leather</li>\r\n	<li>Rounded toe</li>\r\n	<li>Hand-stitched detail</li>\r\n	<li>Leather sole</li>\r\n	<li>Made in Italy</li>\r\n</ul>\r\n</div>', 2, NULL, 'TLJsH4', NULL, NULL, 1, 1, 1, '2020-12-09 13:45:49', '2021-03-14 23:10:04', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '43,44'),
(425, 'Jordaan Horsebit-Detailed Leather Loafers', 'jordaan-horsebit-detailed-leather-loafers', NULL, 16, NULL, NULL, NULL, NULL, '<p>Expertly crafted from ever-luxe black leather, Gucci&#39;s loafers are a sophisticated alternative to the classic ballerinas. Finished with the brand&#39;s iconic horsebit detailing on the upper, they&#39;ll add a preppy polish to dresses and denim alike.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>upper: calf leather</li>\r\n	<li>lining: leather</li>\r\n	<li>sole: leather insole and sole</li>\r\n	<li>round toe</li>\r\n	<li>Made in Italy</li>\r\n</ul>', 2, NULL, 'yOhhxB', NULL, NULL, 1, 0, 1, '2020-12-09 13:49:32', '2021-03-14 23:10:14', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '44.5'),
(426, 'Racetrack Moccasin', 'racetrack-moccasin', NULL, 10, NULL, NULL, NULL, NULL, '<p>This sporty driving shoe in supple grained calf leather is distinguished by its elegant ruthenium accessory, inspired by the S-locks used on Louis Vuitton trunks.</p>\r\n\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>Lining: Leather 100%</p>\r\n\r\n<p>Outer: Leather 100%</p>\r\n\r\n<p>Sole: Rubber 100%</p>\r\n</div>', 2, NULL, '1nprDq', NULL, NULL, 1, 0, 1, '2020-12-09 13:59:07', '2020-12-09 13:59:07', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '43'),
(427, 'Le Loafer leather slippers', 'le-loafer-leather-slippers', NULL, 41, NULL, NULL, NULL, NULL, '<div class=\"mCSB_container\" dir=\"ltr\" id=\"mCSB_1_container\" style=\"left:0px; position:relative; top:-58px\">\r\n<div>\r\n<p>Add a touch of androgyny to your looks with Saint Laurent&#39;s black Le Loafer slippers. Fashioned with round toes, leather insoles and low heels, they&#39;re designed with comfort and style in mind. They will pair effortlessly with everything from skinny jeans to shift dresses.</p>\r\n\r\n<ul>\r\n	<li>upper: leather</li>\r\n	<li>lining: leather</li>\r\n	<li>sole: leather insole and sole</li>\r\n	<li>round toe</li>\r\n	<li>Made in Italy</li>\r\n	<li>Designer colour name: Noir (Chrome Black)</li>\r\n</ul>\r\n</div>\r\n</div>', 2, NULL, 'cSIOZv', NULL, NULL, 1, 1, 1, '2020-12-09 14:07:04', '2020-12-28 00:46:38', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '42.5'),
(428, 'Race Track Moccasin', 'race-track-moccasin', NULL, 10, NULL, NULL, NULL, NULL, '<ul>\r\n	<li style=\"text-align:left\">Both stylish and comfortable, these Louis Vuitton Brown Leather Major Loafers are a wardrobe essential.</li>\r\n	<li style=\"text-align:left\">Crafted from Brown leather, these versatile loafers are accented with silver LV buckles and ruched detailed rounded toes.</li>\r\n	<li style=\"text-align:left\">The insoles are padded and lined with leather with Louis Vuitton labels.</li>\r\n</ul>\r\n\r\n<div class=\"_9584ff _d46645\" style=\"-webkit-text-stroke-width:0px; background-color:#f5f5f5; box-sizing:border-box; color:#000000; font-family:PolarisBook,sans-serif; font-size:14px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; orphans:2; text-align:left; text-decoration-color:initial; text-decoration-style:initial; text-decoration-thickness:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; word-spacing:0px\">\r\n<p>&nbsp;</p>\r\n</div>', 2, NULL, 'FpsAvT', NULL, NULL, 1, 0, 1, '2020-12-09 14:13:24', '2020-12-28 00:47:00', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '41.5'),
(429, 'Loafers With Ball Chain Trim', 'loafers-with-ball-chain-trim', NULL, 35, NULL, NULL, NULL, NULL, '<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<p>Giuseppe Zanotti creates show stopping leather goods for connoisseurs of faultless construction with a slick edginess. Made in Italy from black leather, these loafers with ball chain trim feature a slip-on style, stitching detail around the opening, a stacked heel and a branded insole.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>Sole: Leather 100%</p>\r\n\r\n<p>Outer: Leather 100%</p>\r\n\r\n<p>Lining: Leather 100%</p>\r\n</div>\r\n</div>\r\n</div>', 2, NULL, '1nyPer', NULL, NULL, 1, 0, 1, '2020-12-09 14:19:08', '2021-03-14 23:26:00', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '44'),
(430, 'Men\'s David Double Gancini Bit Thick Lug Leather Loafers', 'mens-david-double-gancini-bit-thick-lug-leather-loafers', NULL, 42, NULL, NULL, NULL, NULL, '<div class=\"accordion-body-wrapper initial\">\r\n<div class=\"accordion-body\">\r\n<div>\r\n<p>Salvatore Ferragamo&#39;s signature loafer gets a striking update with a thick lug sole alongside the iconic appointments.</p>\r\n\r\n<ul>\r\n	<li>Fits true to size, please order normal size</li>\r\n	<li>Leather upper</li>\r\n	<li>Double Gancini bit</li>\r\n	<li>Leather lining</li>\r\n	<li>Rubber lug sole</li>\r\n	<li>Leather/rubber</li>\r\n	<li>Made in Italy</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>', 2, NULL, 'CrlJwD', NULL, NULL, 1, 0, 1, '2020-12-09 14:28:42', '2020-12-09 14:28:42', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '44'),
