(452, 'Izmir sandal - Yellow', 'izmir-sandal-yellow', NULL, 45, NULL, NULL, NULL, NULL, '<div class=\"active fade pl-2 show tab-pane\" id=\"product-desc-content\">\r\n<div class=\"color--primary pb-2 pl-2 product-desc-content\">\r\n<div class=\"active fade pl-2 show tab-pane\" id=\"product-desc-content\">\r\n<div class=\"color--primary pb-2 pl-2 product-desc-content\">\r\n<p>Sandal in calfskin with &quot;H Labyrinthe&quot; print and iconic &quot;H&quot; cut-out.<br />\r\nAn iconic Hermes style, this silhouette is an essential piece in every wardrobe.<br />\r\n<br />\r\nMade in Italy</p>\r\n\r\n<div class=\"ng-trigger ng-trigger-toggleContent toggle-content\" id=\"toggle-content-9a0f8e31-e11f-47b0-b85d-859db9adc0fb\" style=\"opacity:1; visibility:visible\">\r\n<ul>\r\n	<li>Biege leather sole</li>\r\n	<li>Brown leather edge</li>\r\n	<li>Yellow calfskin insole and lining</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 2, NULL, 'HLHdTU', NULL, NULL, 1, 0, 1, '2020-12-10 22:22:52', '2020-12-10 22:22:52', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '44'),
(453, 'Studs Embellished Slide Sandal', 'studs-embellished-slide-sandal', NULL, 35, NULL, NULL, NULL, NULL, '<div>\r\n<p>Studs detail the slim straps of a sleek Italian slide lifted by a covered block heel.</p>\r\n</div>\r\n\r\n<div>Heel style: &nbsp;block/chunky</div>\r\n\r\n<div>Toe style: &nbsp;open toe</div>\r\n\r\n<ul>\r\n	<li>Leather upper, lining and sole</li>\r\n	<li>Made in Italy</li>\r\n	<li>Salon Shoes</li>\r\n</ul>', 2, NULL, 'RImjQp', NULL, NULL, 1, 0, 1, '2020-12-10 22:29:32', '2021-03-14 23:23:41', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '42'),
(454, 'Monogram Motif Cotton Piqué Polo Shirt', 'monogram-motif-cotton-pique-polo-shirt', NULL, 6, NULL, NULL, NULL, NULL, '<div class=\"_01cbfa\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:inherit; color:#222222; font-family:&quot;Farfetch Basis&quot;,&quot;Helvetica Neue&quot;,Arial,sans-serif; font-size:16px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; margin-bottom:0px; margin-right:4.8rem; orphans:2; text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-decoration-thickness:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; width:calc(33.333% - 3.2rem); word-spacing:0px\">\r\n<div class=\"_9584ff\" style=\"box-sizing:inherit; margin-bottom:2.4rem; margin-left:0px; margin-right:0px; margin-top:0px\">\r\n<div class=\"_788468\" id=\"bannerComponents-Container\" style=\"box-sizing:inherit\">A classic polo shirt in cotton piqu&eacute;, updated with an embroidered Monogram motif and our Vintage check at the placket.</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\" style=\"box-sizing:inherit; margin-bottom:0px; margin-left:0px; margin-right:0px; margin-top:2.4rem\">\r\n<p style=\"margin-left:0px; margin-right:0px\">Composition</p>\r\n\r\n<p style=\"margin-left:0px; margin-right:0px\">Cotton 100%</p>\r\n\r\n<p>Washing instructions</p>\r\n\r\n<p>Machine Wash</p>\r\n</div>\r\n</div>', 2, NULL, 'sMZTu1', NULL, NULL, 1, 0, 1, '2020-12-11 00:54:18', '2020-12-28 00:45:29', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, 'L'),
(455, 'Studded Slide Sandal', 'studded-slide-sandal', NULL, 16, NULL, NULL, NULL, NULL, '<ul>\r\n	<li>A bold Gucci logo gleams in marquee-light studs at the bridge of a polished slide sandal detailed under the heel with a signature studded bee.</li>\r\n	<li>Style Name: Gucci Studded Slide Sandal (Men)</li>\r\n	<li>Made in Italy</li>\r\n</ul>', 2, NULL, '1U55Gi', NULL, NULL, 1, 0, 1, '2020-12-12 13:43:45', '2021-03-14 23:10:23', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '41'),
(456, 'Brixton Logo Printed Leather Loafers', 'brixton-logo-printed-leather-loafers', NULL, 16, NULL, NULL, NULL, NULL, '<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<p>Nude beige leather Stamp loafers from Gucci featuring a round toe, a horsebit detail, a branded insole, a flat sole and an all over logo print.</p>\r\n</div>\r\n\r\n<div class=\"_20ef65 _9584ff\">\r\n<p>Made in Italy</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>Lining: Leather 100%</p>\r\n\r\n<p>Outer: Leather 100%</p>\r\n\r\n<p>Sole: Leather 100%</p>\r\n</div>\r\n</div>\r\n</div>', 2, NULL, 'SRNoeL', NULL, NULL, 1, 0, 1, '2020-12-12 14:27:41', '2021-03-14 23:10:48', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '43'),
(457, 'Bee Embroidered Velvet Loafers', 'bee-embroidered-velvet-loafers', NULL, 22, NULL, NULL, NULL, NULL, '<div class=\"mCSB_container\" dir=\"ltr\" id=\"mCSB_2_container\" style=\"left:0px; position:relative; top:0px\">\r\n<div class=\"pdp-accordion__content\">\r\n<div class=\"inner-content\">\r\n<ul>\r\n	<li>COLOUR: Blue</li>\r\n	<li>COMPOSITION: Velvet</li>\r\n	<li>COUNTRY OF ORIGIN: Italy</li>\r\n	<li>Round toe, black stacked wooden heel</li>\r\n	<li>Bee embroidery front detail</li>\r\n	<li>Slip on</li>\r\n	<li>Burgundy leather lining, quilted insole</li>\r\n	<li>Burgundy leather sole</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>', 2, NULL, 'ziLxVi', NULL, NULL, 1, 0, 1, '2020-12-12 14:39:31', '2020-12-28 08:47:29', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '45'),
(458, 'Nappa Intrecciato Slides', 'nappa-intrecciato-slides', NULL, 47, NULL, NULL, NULL, NULL, '<div class=\"mCSB_container\" dir=\"ltr\" id=\"mCSB_1_container\" style=\"left:0px; position:relative; top:0px\">\r\n<div>\r\n<p>Bottega Veneta&#39;s Nappa Intrecciato slides are defined by&nbsp; straps, offering a contemporary take on the Italian label&#39;s iconic intrecciato weave. Crafted in Italy from &quot;Black&quot; lamb leather, this slip-on style is shaped with a square toe and slender black heels. Showcase yours with cropped tailoring.</p>\r\n&nbsp;\r\n\r\n<ul>\r\n	<li>upper: leather</li>\r\n	<li>lining: leather</li>\r\n	<li>sole: leather insole and sole</li>\r\n	<li>square open toe</li>\r\n	<li>Made in Italy</li>\r\n	<li>Designer colour name: Black</li>\r\n</ul>\r\n</div>\r\n</div>', 2, NULL, 'IJ1inw', NULL, NULL, 1, 0, 1, '2020-12-23 11:29:02', '2020-12-23 11:29:02', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '41'),
(459, 'Bow Detail Loafers', 'bow-detail-loafers', NULL, 22, NULL, NULL, NULL, NULL, '<div class=\"_01cbfa\">\r\n<div class=\"_9584ff\">\r\n<div class=\"_788468\">Bow detail loafers</div>\r\n</div>\r\n\r\n<div class=\"_9584ff\">\r\n<p>When in doubt just put a bow on it! Spun from soft cotton-blend, these bow detail slippers from Dolce &amp; Gabbana will keep the feminity levels high. Effortless elegance! Featuring an almond toe, a slip-on style, a bow detail, a branded insole and a flat sole.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"_01cbfa\">\r\n<div class=\"_0791d9 _9584ff\">\r\n<div class=\"_9584ff _d46645\">\r\n<h4>Composition</h4>\r\n\r\n<p>Cotton 74%, Viscose 16%, Silk 10%</p>\r\n</div>\r\n</div>\r\n</div>', 2, NULL, 'ZcmM8e', NULL, NULL, 1, 0, 1, '2020-12-23 11:36:06', '2020-12-23 11:36:06', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '45'),
(460, 'Izmir sandal - Deep blue', 'izmir-sandal-deep-blue', NULL, 45, NULL, NULL, NULL, NULL, '<div class=\"active fade pl-2 show tab-pane\" id=\"product-desc-content\">\r\n<div class=\"color--primary pb-2 pl-2 product-desc-content\">\r\n<div class=\"active fade pl-2 show tab-pane\" id=\"product-desc-content\">\r\n<div class=\"color--primary pb-2 pl-2 product-desc-content\">\r\n<div class=\"active fade pl-2 show tab-pane\" id=\"product-desc-content\">\r\n<div class=\"color--primary pb-2 pl-2 product-desc-content\">\r\n<p>Sandal in calfskin with &quot;H Labyrinthe&quot; print and iconic &quot;H&quot; cut-out.<br />\r\nAn iconic Hermes style, this silhouette is an essential piece in every wardrobe.<br />\r\n<br />\r\nMade in Italy</p>\r\n\r\n<div class=\"ng-trigger ng-trigger-toggleContent toggle-content\" id=\"toggle-content-9a0f8e31-e11f-47b0-b85d-859db9adc0fb\" style=\"opacity:1; visibility:visible\">\r\n<ul>\r\n	<li>Black leather sole</li>\r\n	<li>Blue leather edge</li>\r\n	<li>Black calfskin insole and lining</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 2, NULL, '2ixH5r', NULL, NULL, 1, 0, 1, '2020-12-23 11:40:31', '2020-12-23 11:40:31', NULL, 0, NULL, NULL, NULL, NULL, NULL, 'variable', 0, '44');
